import { Component } from '@angular/core';

@Component({
  selector: 'app-layout',
  templateUrl: './layout.component.html',
  styleUrls: ['./layout.component.css']
})
export class LayoutComponent {
  modalOpen: boolean = false


  modaltoggle(open: boolean) {
    this.modalOpen = open
  }
}
